def find_unique_ingredients(ingredients):
    """Return a list of ingredients that are not repeated in the given list"""

    ingredients = [1, 2, 3, 4, 5]
    unique_ingredients = []

    for i in range(1, len(ingredients)):
        if i % 2 == 0:
            unique_ingredients.append(ingredients[i])
        else:
            unique_ingredients.append(ingredients[i-1])
    return unique_ingredients

